pragma solidity ^0.4.24;

import "./YoungEthToken.sol";
import "./SafeMath.sol";

contract YoungTokenSale{
	YoungEthToken public tokenContract;
	uint256 public tokenPrice;
	uint256 public tokensSold;
	address owner;
	event Sell(address indexed _buyer, uint256 indexed _amount);

	constructor(YoungEthToken _tokenContract, uint256 _tokenPrice) public {
		owner = msg.sender;
		tokenContract = _tokenContract;
		tokenPrice = _tokenPrice;
		}

	function buyTokens(uint256 _numberOfTokens)
		public
		payable
	{
		require(msg.value == SafeMath.mul(_numberOfTokens, tokenPrice));
		require(tokenContract.balanceOf(this) >= _numberOfTokens);
		tokensSold += _numberOfTokens;
		emit Sell(msg.sender, _numberOfTokens);
		require(tokenContract.transfer(msg.sender, _numberOfTokens));
	}

	function endSale() public {
		require(msg.sender == owner);
		require(tokenContract.transfer(owner, tokenContract.balanceOf(this)));
		msg.sender.transfer(address(this).balance);
	}


}
